import { FullScreenContainer } from "../common/loginsignupstyles"
import {AppDiv,CenterAppbar,StyledImage} from "./Dashboard.styles"
export const Dashboard = () => {
    return (
      <FullScreenContainer>
        <AppDiv>
          <CenterAppbar>
            <StyledImage src="path_to_your_image" alt="Description" />
            <p>Welcome to the Dashboard!</p>
          </CenterAppbar>
        </AppDiv>
      </FullScreenContainer>
    );
  };
